import React from "react";

const skills = ["HTML", "CSS", "JavaScript", "React", "Spring Boot", "Thymeleaf"];

export default function Skill() {
  return (
    <section id="skill">
      <h2>Skill</h2>
      <div className="tech-cards">
        {skills.map((skill, idx) => (
          <div key={idx} className="tech-card">
            {skill}
          </div>
        ))}
      </div>
    </section>
  );
}
